import React, { Component } from 'react';

import api from '../services/api';
import axios from 'axios';

import './FilterPlaylist.css';

import {
	InputGroup,
	FormControl,
	Button,
	Collapse,
	Form
} from 'react-bootstrap';

export default class FilterPlaylist extends Component {
	state = {
		search: '',
		playlists: '',
		filters: [],
		openFilterOptions: false
	};

	async componentDidMount() {
		const response = await axios.get(
			'http://www.mocky.io/v2/5a25fade2e0000213aa90776'
		);

		this.setState({ filters: response.data.filters });
		console.log('FILTERS: ', response);
	}

	handleNewSearch = async e => {
		if (e.keyCode !== 13) return;

		const search = this.state.search;

		const searchResponse = await api.get('search', {
			params: {
				type: 'playlist',
				q: search,
				limit: 2
			}
		});

		console.log('SEARCH: ', searchResponse);

		this.setState({ search: '' });
	};

	handleSearchChange = e => {
		this.setState({ search: e.target.value });
		console.log(this.state.search);
	};
	render() {
		const { openFilterOptions } = this.state;
		return (
			<>
				<div className="filter-options">
					<InputGroup className="search-form">
						<InputGroup.Prepend>
							<InputGroup.Text id="basic-addon1">@</InputGroup.Text>
						</InputGroup.Prepend>
						<FormControl
							placeholder="Search a playlist"
							aria-label="Search"
							value={this.state.search}
							onChange={this.handleSearchChange}
							onKeyDown={this.handleNewSearch}
						/>
					</InputGroup>

					<div className="button-filter-options">
						<Button
							onClick={() =>
								this.setState({ openFilterOptions: !openFilterOptions })
							}
							aria-controls="example-collapse-text"
							aria-expanded={openFilterOptions}
							style={{
								backgroundColor: 'rgb(0, 225, 85)',
								border: 0,
								fontWeight: '500'
							}}
						>
							Filter Options
						</Button>
					</div>
				</div>
				<br />
				<div>
					{/* <Collapse in={this.state.openFilterOptions}>
						<div id="example-collapse-text">
							Anim pariatur cliche reprehenderit, enim eiusmod high life
							accusamus terry richardson ad squid. Nihil anim keffiyeh
							helvetica, craft beer labore wes anderson cred nesciunt sapiente
							ea proident.
						</div>
					</Collapse> */}
					<p className="title-text">Filters Options</p>
					<div className="filter-form">
						<Form style={{}}>
							<Form.Row>
								<Form.Group as="column" controlId="formGridState">
									<Form.Label
										style={{
											color: 'rgb(236, 236, 236)',
											fontWeight: 'bold'
										}}
									>
										State
									</Form.Label>
									<FormControl as="select">
										<option>Choose...</option>
										<option>...</option>
									</FormControl>
								</Form.Group>
								<Form.Group as="column" controlId="formGridState">
									<Form.Label
										style={{
											color: 'rgb(236, 236, 236)',
											fontWeight: 'bold'
										}}
									>
										State
									</Form.Label>
									<FormControl as="select">
										<option>Choose...</option>
										<option>...</option>
									</FormControl>
								</Form.Group>
							</Form.Row>

							<Button variant="primary" type="submit">
								Submit
							</Button>
						</Form>
					</div>
				</div>
			</>
		);
	}
}
